export interface Coords {
	x: number;
	y: number;
}

import { Injectable } from '@angular/core';
import { DiagramModel, PointModel } from '../models';
import * as dagre from 'dagre';
import { GraphLabel, NodeConfig, EdgeConfig } from 'dagre';

export interface DagreEngineOptions {
	graph?: GraphLabel;
	layout?: GraphLabel & NodeConfig & EdgeConfig;
	/**
	 * Will also layout links
	 */
	includeLinks?: boolean;
}

@Injectable()
export class DagreEngine {
	g: dagre.graphlib.Graph;
	constructor() {
		try {
			this.g = new dagre.graphlib.Graph({ multigraph: true });
		} catch (error) {
			console.warn("`dagre` packages isn't installed, please install it before using the DagreEngine plugin");
		}
	}

	redistribute(model: DiagramModel, options: DagreEngineOptions = {}): void {
		this.g.setGraph(options.graph || {});

		this.g.setDefaultEdgeLabel(() => {
			return {};
		});

		const processedlinks: { [id: string]: boolean } = {};

		// set nodes
		Object.values(model.getNodes()).forEach(node => {
			this.g.setNode(node.id, { width: node.getWidth(), height: node.getHeight() });
		});

		Object.values(model.getLinks()).forEach(link => {
			// set edges
			if (link.getSourcePort() && link.getTargetPort()) {
				processedlinks[link.id] = true;
				this.g.setEdge({
					v: link.getSourcePort().getNode().id,
					w: link.getTargetPort().getNode().id,
					name: link.id,
				});
			}
		});

		// layout the graph
		dagre.layout(this.g, options.layout);

		this.g.nodes().forEach(v => {
			const { x, y } = this.g.node(v);
			model.getNode(v).setCoords({ x, y });
		});

		// also include links?
		if (options.includeLinks) {
			this.g.edges().forEach(e => {
				const edge = this.g.edge(e);
				const link = model.getLink(e.name);

				const points = [link.getFirstPoint()];
				for (let i = 1; i < edge.points.length - 2; i++) {
					points.push(new PointModel(link, { x: edge.points[i].x, y: edge.points[i].y }));
				}
				link.setPoints(points.concat(link.getLastPoint()));
			});
		}
	}
}

import { PortModel } from '../../models/port.model';
import { LinkModel } from '../../models/link.model';
import { DefaultLinkModel } from './default-link.model';

export interface DefaultPortModelConfig {
	id?: string;
	isInput?: boolean;
	name?: string;
	type?: string;
	label?: string;
	linkType?: string;
}

export class DefaultPortModel extends PortModel {
	in: boolean;
	label: string;
	links: { [id: string]: any };

	constructor({
		isInput = true,
		name = 'port',
		type = 'default',
		id = null,
		label = null,
		linkType = 'default',
	}: DefaultPortModelConfig = {}) {
		super(name, type, id, null, linkType);
		this.in = isInput;
		this.label = label || name;

		if (this.in) {
			this.setCanCreateLinks(false);
		} else {
			this.setMagnetic(false);
		}
	}

	link(port: PortModel): LinkModel {
		const link = this.createLinkModel();
		link.setSourcePort(this);
		link.setTargetPort(port);
		return link;
	}

	canLinkToPort(port: PortModel): boolean {
		if (port instanceof DefaultPortModel) {
			return this.in !== port.in;
		}
		return true;
	}

	createLinkModel(): LinkModel {
		const link = super.createLinkModel();
		return link || new DefaultLinkModel(this.getLinkType());
	}
}

import { ID, UID } from '../utils/tool-kit.util';
import { BaseEntity } from '../base.entity';

// region events
export class BaseEvent<T extends BaseEntity> {
	entity: T;
	entityId: ID;
	stopPropagation: () => any;
	firing: boolean;
	id: ID;
	propogate: boolean;

	constructor(entity: T, options?: any) {
		this.id = UID();
		this.entity = entity;
		this.entityId = entity.id;
		this.firing = true;
		this.stopPropagation = () => (this.firing = false);
		this.propogate = options ? options.propagate : null;
	}
}
export class LockEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	locked: boolean;

	constructor(entity: T, locked: boolean = false) {
		super(entity);
		this.locked = locked;
	}
}
export class ParentChangeEvent<P extends BaseEntity = BaseEntity, T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	parent: P;

	constructor(entity: T, parent: P) {
		super(entity);
		this.parent = parent;
	}
}
export class SelectionEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	isSelected: boolean;

	constructor(entity: T, selected: boolean) {
		super(entity);
		this.isSelected = selected;
	}
}
export class PaintedEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	isPainted: boolean;

	constructor(entity: T, painted: boolean = false) {
		super(entity);
		this.isPainted = painted;
	}
}

