	constructor(link: LinkModel, { x, y }: Coords) {
		super();
		this._coords = new BehaviorSubject<Coords>({ x, y });
		this.coords$ = this._coords.asObservable();
		this.setParent(link);
	}

	isConnectedToPort() {
		return this.getParent().getPortForPoint(this) !== null;
	}

	getLink(): LinkModel {
		return this.getParent();
	}

	destroy(options?: DestroyOptions) {
		if (this.getParent) {
			this.getParent().removePoint(this);
		}

		super.destroy(options);
	}

	setCoords(newCoords: Partial<Coords>) {
		this._coords.next({ ...this._coords.getValue(), ...newCoords });
	}

	selectCoords(): Observable<Coords> {
		return this.coords$.pipe(takeUntil(this.onEntityDestroy()), distinctUntilChanged());
	}

	getCoords(): Coords {
		return this._coords.getValue();
	}

	selectX(): Observable<number> {
		return this.selectCoords().pipe(
			map(c => c.x),
			distinctUntilChanged()
		);
	}

	selectY(): Observable<number> {
		return this.selectCoords().pipe(
			map(c => c.y),
			distinctUntilChanged()
		);
	}
}

import { BaseModel } from './base.model';
import { NodeModel } from './node.model';
import { LinkModel } from './link.model';
import { BehaviorSubject, Observable } from 'rxjs';
import { DestroyOptions } from '../interfaces';

export class PortModel extends BaseModel<NodeModel> {
	private name: string;
	private links$: BehaviorSubject<{ [id: string]: LinkModel }>;
	private maximumLinks: number;
	private linkType: string;

	private x$: BehaviorSubject<number>;
	private y$: BehaviorSubject<number>;
	private magnetic$: BehaviorSubject<boolean>;
	private width$: BehaviorSubject<number>;
	private height$: BehaviorSubject<number>;
	private canCreateLinks$: BehaviorSubject<boolean>;

	constructor(name: string, type?: string, id?: string, maximumLinks?: number, linkType?: string, magnetic: boolean = true) {
		super(type, id);
		this.name = name;
		this.magnetic$ = new BehaviorSubject(magnetic);
		this.links$ = new BehaviorSubject({});
		this.maximumLinks = maximumLinks;
		this.x$ = new BehaviorSubject(0);
		this.y$ = new BehaviorSubject(0);
		this.height$ = new BehaviorSubject(0);
		this.width$ = new BehaviorSubject(0);
		this.canCreateLinks$ = new BehaviorSubject(true);
		this.linkType = linkType;
	}

	getNode() {
		return this.getParent();
	}

	getName() {
		return this.name;
	}

	getCanCreateLinks() {
		return this.canCreateLinks$.getValue();
	}

	getCoords() {
		return { x: this.getX(), y: this.getY() };
	}

	selectCanCreateLinks() {
		return this.canCreateLinks$.asObservable();
	}

	setCanCreateLinks(value: boolean) {
		this.canCreateLinks$.next(value);
	}

	getMagnetic() {
		return this.magnetic$.getValue();
	}

	selectMagnetic() {
		return this.magnetic$.asObservable();
	}

	setMagnetic(magnetic: boolean) {
		this.magnetic$.next(magnetic);
	}

	selectX(): Observable<number> {
		return this.x$.asObservable();
	}

	selectY(): Observable<number> {
		return this.y$.asObservable();
	}

	getY() {
		return this.y$.getValue();
	}

	getX() {
		return this.x$.getValue();
	}

	getHeight() {
		return this.height$.getValue();
	}

	getWidth() {
		return this.width$.getValue();
	}

	getMaximumLinks(): number {
		return this.maximumLinks;
	}

	setMaximumLinks(maximumLinks: number) {
		this.maximumLinks = maximumLinks;
	}

	getLinkType() {
		return this.linkType;
	}

	setLinkType(type: string) {
		this.linkType = type;
	}

	removeLink(link: LinkModel) {
		const links = this.links$.getValue();
		delete links[link.id];
		this.links$.next({ ...links });
	}

	addLink(link: LinkModel) {
		this.links$.next({ ...this.links$.value, [link.id]: link });
	}

	getLinks(): { [id: string]: LinkModel } {
		return this.links$.getValue();
	}

	selectLinks(): Observable<{ [id: string]: LinkModel }> {
		return this.links$.asObservable();
	}

	updateCoords({ x, y, width, height }: { x: number; y: number; width: number; height: number }) {
		this.x$.next(x);
		this.y$.next(y);
		this.width$.next(width);
		this.height$.next(height);
	}

	canLinkToPort(port: PortModel): boolean {
		return true;
	}

	isLocked() {
		return super.getLocked();
	}

	destroy(options?: DestroyOptions) {
		super.destroy(options);

		Object.values(this.getLinks()).forEach(link => {
			link.destroy();
		});
	}

	public createLinkModel(): LinkModel | null {
		const numberOfLinks: number = Object.keys(this.links$.getValue()).length;
		if (this.maximumLinks === 1 && numberOfLinks >= 1) {
			const linkToRemove = Object.values(this.links$.getValue())[0];
			if (linkToRemove) {
				linkToRemove.destroy();
			}
			return null;
		} else if (numberOfLinks >= this.maximumLinks) {
			// for the moment we will remove the first link by default
			const linkToRemove = Object.values(this.links$.getValue())[0];
			if (linkToRemove) {
				linkToRemove.destroy();
			}
			return null;
		}
		return null;
	}
}

import { BaseAction } from './base.action';
import { DiagramModel } from '../models/diagram.model';
import { Coords } from '../interfaces/coords.interface';

export class SelectingAction extends BaseAction {
	mouseX2: number;
	mouseY2: number;

	dimensions: {
		top: number;
		left: number;
		width: number;
		height: number;
		right: number;
		bottom: number;
	};

	constructor(mouseX: number, mouseY: number) {
		super(mouseX, mouseY);
		this.mouseX2 = mouseX;
		this.mouseY2 = mouseY;
	}

	getBoxDimensions() {
		this.dimensions = {
			left: this.mouseX2 > this.mouseX ? this.mouseX : this.mouseX2,
			top: this.mouseY2 > this.mouseY ? this.mouseY : this.mouseY2,
			width: Math.abs(this.mouseX2 - this.mouseX),
			height: Math.abs(this.mouseY2 - this.mouseY),
			right: this.mouseX2 < this.mouseX ? this.mouseX : this.mouseX2,
			bottom: this.mouseY2 < this.mouseY ? this.mouseY : this.mouseY2
		};
		return this.dimensions;
	}

	containsElement({ x, y }: Coords, diagramModel: DiagramModel): boolean {
		const z = diagramModel.getZoomLevel() / 100.0;
		const dimensions = this.getBoxDimensions();

		return (
			x * z + diagramModel.getOffsetX() > dimensions.left &&
			x * z + diagramModel.getOffsetX() < dimensions.right &&
			y * z + diagramModel.getOffsetY() > dimensions.top &&
			y * z + diagramModel.getOffsetY() < dimensions.bottom
		);
	}
}

import { ID, UID } from '../utils/tool-kit.util';
import { BaseEntity } from '../base.entity';

// region events
export class BaseEvent<T extends BaseEntity> {
	entity: T;
	entityId: ID;
	stopPropagation: () => any;
	firing: boolean;
	id: ID;
	propogate: boolean;

	constructor(entity: T, options?: any) {
		this.id = UID();
		this.entity = entity;
		this.entityId = entity.id;
		this.firing = true;
		this.stopPropagation = () => (this.firing = false);
		this.propogate = options ? options.propagate : null;
	}
}
export class LockEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	locked: boolean;

	constructor(entity: T, locked: boolean = false) {
		super(entity);
		this.locked = locked;
	}
}
export class ParentChangeEvent<P extends BaseEntity = BaseEntity, T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	parent: P;

	constructor(entity: T, parent: P) {
		super(entity);
		this.parent = parent;
	}
}
export class SelectionEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	isSelected: boolean;

	constructor(entity: T, selected: boolean) {
		super(entity);
		this.isSelected = selected;
	}
}
export class PaintedEvent<T extends BaseEntity = BaseEntity> extends BaseEvent<T> {
	isPainted: boolean;

	constructor(entity: T, painted: boolean = false) {
		super(entity);
		this.isPainted = painted;
	}
}

export interface DestroyOptions {
	propagate?: boolean;
	emit?: boolean;
}
// endregion

